import { Box } from '@mui/system';
import Grid from '@mui/material/Grid';
import React, { Component } from 'react';

const Feed = () => {
    return (
        <Box sx={{flexGrow: 1}}>
            <Grid container spacing={2}>
                <Grid item xs={4}>
                    Task Name
                </Grid>
            </Grid>
        </Box>
    )
}

export default Feed;
